     constructor(props){
          super(props);

          this.state={
               title:props.title,
               function_passed:props.function_passed
          }
     }

     render(){
          return(
               
               <TouchableHighlight style={first_style.buttons} onPress={() => function_passed()}>

                    <Text style={{fontWeight:'bold', fontSize:wp(1.5)+hp(1.5), color:'white'}}> {title} </Text>

               </TouchableHighlight>

          )

}
}
